import React, { useState } from "react";

const App = () => {
  const [number, setNumber] = useState(20);

  const handleOlder = () => {
    setNumber(number + 1);
  };

  return (
    <>
      <span>Hoy tengo {number} años de edad" </span>
      <button type="button" onClick={handleOlder}>
        Hazme más viejo
      </button>
    </>
  );
};

export default App;
